import { Box, Button, Flex, Select, HStack, Icon } from "@chakra-ui/react";
import { HamburgerIcon, SunIcon, CalendarIcon } from "@chakra-ui/icons";
import { MdInbox, MdDarkMode } from "react-icons/md";
import { useState } from "react";

const Nav = () => {
	const [toggled, setToggled] = useState(true);

	const onClick = () => {
		setToggled(!toggled);
	};

	return (
		<Box as="header" bg="rgb(32, 35, 38)" p="1em">
			<Flex justifyContent="space-between">
				<Button
					onClick={onClick}
					bg="none
                "
					colorScheme="blackAlpha"
				>
					<HamburgerIcon color="#fff" w="25" height="25" />
				</Button>

				<HStack spacing="2">
					<Button
						bg="none
                "
						colorScheme="blackAlpha"
					>
						<SunIcon color="#fff" w="25" height="25" />
					</Button>

					<Button
						bg="none
                "
						colorScheme="blackAlpha"
					>
						<CalendarIcon color="#fff" w="25" height="25" />
					</Button>
					<Button
						bg="none
                "
						colorScheme="blackAlpha"
					>
						<Icon as={MdInbox} color="#fff" w="30px" height="30px" />
					</Button>
				</HStack>
			</Flex>
		</Box>
	);
};

export default Nav;
